import axios from 'axios';

class RestClient {
    static GetRequest = (getUrl)=>{
        return axios.get(getUrl).then (response=>{
            return response.data;
        }).catch(error=>{
            return null;
        })
    }

    static PostRequest = (getUrl)=>{
        let config =  {headers: {
            'Content-Type': 'application/json'
        }}
        return axios.get(getUrl).then (response=>{
            return response.data;
        }).catch(error=>{
            return null;
        })
    }

}
export default RestClient
